var ArticlesApp={load:function(){switch(window.location.hash.split("-")[0]){case"#create":console.log("CREATE");break;case"#view":console.log("VIEW");break;case"#edit":console.log("EDIT");break;case"#delete":console.log("DELETE");break;default:!function(){let e=window.location.origin+"/api/articles",t=new XMLHttpRequest;t.open("GET",e),t.setRequestHeader("Content-Type","application/json; charset=UTF-8"),t.send(),t.onload=function(){let e=document.getElementById("app"),n=JSON.parse(t.response).articles,a="",d="";for(let e=0;e<n.length;e++)d+=`<tr>\n      <td>\n        <a href="#view-${n[e]._id}">${n[e].title}, ${n[e].description}</a>\n      </td>\n      <td>${n[e].keywords}</td>\n      <td>${n[e].body}</td>\n    </tr>`;a=`<div class="card">\n    <div class="card-header clearfix">\n      <h2 class="h3 float-left">Users</h2>\n      <div class="float-right">\n        <a href="#create" class="btn btn-primary">New Article</a>\n      </div>\n    </div>\n    <div class="table-responsive">\n      <table class="table table-striped table-hover table-bordered">\n        <thead>\n          <tr>\n            <td>Title</td>\n            <td>Description</td>\n            <td>Keywords</td>\n          </tr>\n        </thead>\n        <tbody>${d}</tbody>\n      </table>\n    </div>\n  </div>`,e.innerHTML=a}}()}}};articlesApp.load(),window.addEventListener("hashchange",(function(){articlesApp.load()}));